"use strict";
//Я прочитал на вас челодой моловек на знание базовой математики 

function sumSothing(arr){
    let int1 = arr.sort((a,b)=> a-b)[0];
    let int2 = arr.sort((a,b)=> a-b)[1];

    //Посчитаем сколько символов то в прогресии зная что шаг = 1

    let n = int2 + 1 -int1;

    return ((int1 + int2)/2) * n;
}

console.log(sumSothing([-1,10]));











 
